module.exports=function(){function Complex(re=0,im=0){this.re=re;this.im=im}const msgs={errNotNumeric:"{0} must be a number."};Complex.prototype.getMsg=function(key,repArr=null){const msg=msgs[key];return repArr?msg.replace(/{(\d+)}/g,((match,i)=>repArr[i]!==undefined?repArr[i]:match)):msg};Complex.prototype.setRe=function(re){if(typeof re!=="number"){throw new Error(this.getMsg("errNotNumeric",["Specified real value"]))}this.re=re;return this};Complex.prototype.setIm=function(im){if(typeof im!=="number")throw new Error(this.getMsg("errNotNumeric",["Specified imaginary value"]));this.im=im;return this};Complex.prototype.setRectCoords=function(re,im){if(typeof re!=="number"||typeof im!=="number")throw new Error(this.getMsg("errNotNumeric",["Specified real value and imaginary value"]));this.re=re;this.im=im;return this};Complex.prototype.setPolarCoords=function(r,phi){if(typeof r!=="number"||typeof phi!=="number")throw new Error(this.getMsg("errNotNumeric",["Specified r(radius) value and phi(angle) value"]));return this.setRectCoords(r*Math.cos(phi),r*Math.sin(phi))};return Complex}();